import "bootstrap/dist/css/bootstrap.min.css"
import Routes from "./Routes.js"
import AuthenticatedUserProvider from "./contexts/AuthenticatedUser.js";

function App() {
  return (
    <div>    <AuthenticatedUserProvider>
    <Routes />
    </AuthenticatedUserProvider></div>

  );
}

export default App;
